import React from 'react';

import './Main.css';

export default function Main({cityCOL1, cityCOL2, cityName1, cityName2, salary1, salary2}) {
    const cheaperJob = () => {
        if (salary1 > salary2) {
            return cityName1;
        } else {
            return cityName2;
        }
    }

    return (
        <div className='main'>
            <div className='section1'>
                <p className='section1-text'>

                </p>
            </div>
        </div>
    );
}
